import About from "../Pages/About";
import Home from "../Pages/Home";
import Login from "../Pages/Login";
import Search from "../Pages/Search";
import Shop from "../Pages/Shop";
import Signup from "../Pages/Signup";
import AllProducts from "../Pages/AllProducts";
import SupportHelp from "../Pages/SupportHelp";
import Faq from "../Pages/Faq";
import Contact from "../Pages/Contact";
import Blog from "../Pages/Blog";
import Games from "../Pages/Games";
import MonsterArena from "../Pages/MonsterArena";
import TShirt from "../Pages/TShirt";
import MonsterScreenshot from "../Pages/MonsterScreenshot";
import MonsterSystems from "../Pages/MonsterSystems";
import MonsterContent from "../Pages/MonsterContent";
import MonsterVideos from "../Pages/MonsterVideos";
import MonsterNews from "../Pages/MonsterNews";
import Forums from "../Pages/Forums";
import Career from "../Pages/Career";
import ViewCart from "../Pages/ViewCart";
import BillingDetails from "../Pages/BillingDetails";
import Payment from "../Pages/Payment";

export const defaultRoutes = [
  {
    path: "/",
    component: Home,
  },
  {
    path: "/search",
    component: Search,
  },
  {
    path: "/login",
    component: Login,
  },
  {
    path: "/signup",
    component: Signup,
  },
  {
    path: "/about",
    component: About,
  },
  {
    path: "/shop",
    component: Shop,
  },
  {
    path: "/allProducts",
    component: AllProducts,
  },
  {
    path: "/support-help",
    component: SupportHelp,
  },
  {
    path: "/faq",
    component: Faq,
  },
  {
    path: "/contact",
    component: Contact,
  },
  {
    path: "/blog",
    component: Blog,
  },
  {
    path: "/games",
    component: Games,
  },
  {
    path: "/tshirt",
    component: TShirt,
  },
  {
    path: "/monsterArena",
    component: MonsterArena,
  },
  {
    path: "/monsterScreenshot",
    component: MonsterScreenshot,
  },
  {
    path: "/monsterSystems",
    component: MonsterSystems,
  },
  {
    path: "/monsterContent",
    component: MonsterContent,
  },
  {
    path: "/monsterVideos",
    component: MonsterVideos,
  },
  {
    path: "/monsterNews",
    component: MonsterNews,
  },
  {
    path: "/forums",
    component: Forums,
  },
  {
    path: "/career",
    component: Career,
  },
  {
    path: "/viewCart",
    component: ViewCart,
  },
  {
    path: "/billingDetails",
    component: BillingDetails,
  },
  {
    path: "/payment",
    component: Payment,
  },
];
